DROP TABLE IF EXISTS contact_ball_of_mud;
CREATE TABLE contact_ball_of_mud ( 
  id BIGINT NOT NULL AUTO_INCREMENT, 
  number BIGINT, 
  gender VARCHAR(45), 
  givenname VARCHAR(45), 
  middleinitial VARCHAR(45), 
  surname VARCHAR(45), 
  streetaddress VARCHAR(45), 
  city VARCHAR(45), 
  state VARCHAR(45), 
  zipcode VARCHAR(45), 
  country VARCHAR(45), 
  emailaddress VARCHAR(45), 
  password VARCHAR(45), 
  telephonenumber VARCHAR(45), 
  mothersmaiden VARCHAR(45), 
  birthday DATETIME, 
  CCType VARCHAR(45), 
  CCNumber VARCHAR(45), 
  CVV2 VARCHAR(5), 
  CCExpires DATETIME, 
  NationalID VARCHAR(45), 
  UPS VARCHAR(45), 
  Occupation VARCHAR(45), 
  PRIMARY KEY (id), 
  CONSTRAINT number_UNIQUE UNIQUE (number) 
  );

DROP TABLE IF EXISTS inv;
CREATE TABLE inv ( 
  invid INT NOT NULL, 
  invnumber VARCHAR(75) NOT NULL, 
  datetimecreated DATETIME NOT NULL, 
  udtime TIME NOT NULL, 
  uddate DATE NOT NULL, 
  terms VARCHAR(15), 
  PRIMARY KEY (invid) 
  );

DROP TABLE IF EXISTS lidetail;
CREATE TABLE lidetail ( 
  invoice_id BIGINT NOT NULL, 
  row_number BIGINT NOT NULL, 
  comment VARCHAR(255) 
  );

DROP TABLE IF EXISTS lineitem;
CREATE TABLE lineitem ( 
  invid BIGINT NOT NULL, 
  row_num BIGINT NOT NULL, 
  pn VARCHAR(50) NOT NULL, 
  qty BIGINT NOT NULL, 
  price DECIMAL, 
  PRIMARY KEY (invid, row_num) 
  );
